import React from 'react'
import { Grid} from '@material-ui/core'
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import { display } from '@material-ui/system';



const useStyles = makeStyles({
    card: {
      maxWidth: 345,
      marginRight:"20px"
    },
    media: {
      height: "314px",
    },

    grid:{
        margin:"30px",
        display:"flex",
        jus
    },

    telefonos:{
        fontSize:"25px",
    }
  });

const contacto = () => {
    const classes = useStyles();
    return (
        <div className="container">
                        <Grid className={classes.grid}>
                <Card className={classes.card}>
                    <CardActionArea>
                        <CardMedia
                            className={classes.media}
                            image="img/telefono.jpg"
                            title="Contemplative Reptile"
                        />
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="h2">
                             Telefonos
                          </Typography >
                            <Typography className={classes.telefonos} variant="body2" color="textSecondary" component="p">
                              09992881649 / 4511647 /984782051 correo: Progectseplom@gmail.com

                       </Typography>
                        </CardContent>
                    </CardActionArea>
                    <CardActions>
                        <Button size="small" color="primary">
                            Compartir
                     </Button>
                     
                    </CardActions>
                </Card>
            
                <Card className={classes.card}>
                    <CardActionArea>
                        <CardMedia
                            className={classes.media}
                            image="img/detector.jpg"
                            title="Contemplative Reptile"
                        />
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="h2">
                              TRABAJOS FUTUROS
                          </Typography>
                            <Typography variant="body2" color="textSecondary" component="p">
                                Establecer soluciones con detectores tecnológicos de fugas 

                       </Typography>
                       <Typography variant="body2" color="textSecondary" component="p">
                       Establecer un CEDE de operaciones con todas las funcionalidades administrativas

                       </Typography>
                       
                        </CardContent>
                    </CardActionArea>
                    <CardActions>
                        <Button size="small" color="primary">
                            Compartir
                     </Button>
                   
                      
                    </CardActions>
                </Card>
      
                

            </Grid>

            
        </div>
    )
}

export default contacto
